import React from "react";
import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View } from "react-native";
import ResultsList from "./src/screens/LocationName";
//import ResultsListContainer from "./src/screens/ResultsListContainer";
import { restaurantList } from "./src/screens/restaurantList";

export default function App() {
  return (
    <View>
      <ResultsList
        locationName={restaurantList[0].restaurantName}
        distance={restaurantList[0].distance}
      />
      <ResultsList
        locationName={restaurantList[1].restaurantName}
        distance={restaurantList[1].distance}
      />
      <ResultsList
        locationName={restaurantList[2].restaurantName}
        distance={restaurantList[2].distance}
      />
      <ResultsList
        locationName={restaurantList[3].restaurantName}
        distance={restaurantList[3].distance}
      />
    </View>
  );
}

const styles = StyleSheet.create({
  listContainer: {
    marginTop: 100,
    backgroundColor: "#232323",
    flexDirection: "row",
    justifyContent: "space-between",
  },
});
